import React from 'react';
import logo from './logo.svg';
import './App.css';
import Button from '@material-ui/core/Button';
function App() {
  return (
    <div className="App">
      <header className="App-header">
      {/* start */}
      <Button onClick={this.handleClick} variant="contained" color="primary">
      Demo
      </Button>
      {/* end */}
      </header>
    </div>
  );
}

export default App;
